			$svg_html         = '<svg class="uasvg-wave-slide-separator"xmlns="http://www.w3.org/2000/svg" fill="' . $row->uabb_row_separator_color . '" opacity="' . $top_separator_color . '" width="100" height="' . $row->separator_shape_height . '" preserveAspectRatio="none" viewBox="0 0 1600 200"><path id="uabb-' . esc_attr( $row->separator_flag ) . '-wave-slide-separator1" d="M-8,95.3C-8,95.3,189,2,398,2s604,184.7,800,184.7s412-91.4,412-91.4V271H-8V95.3
		z"></path><path id="uabb-' . esc_attr( $row->separator_flag ) . '-wave-slide-separator2" d="M1610,95.3c0,0-216,80-412,80c-98,0-245.8-40.5-395.1-80.9
		c149.4,46.2,297.1,92.3,395.1,92.3C1394,186.7,1610,95.3,1610,95.3z"></path></svg>';
			break;
		case 'round_split':
			$separator_class .= ' uabb-round-split';
			break;
		case 'none':
			break;
		default:
			if ( has_filter( 'uabb_row_separator_svg_' . $row->separator_shape ) ) {
				$is_svg           = true;
				$separator_class .= ' uabb-has-svg';
			}

			$separator_class .= ' uabb-' . esc_attr( $row->separator_flag ) . '-' . $row->separator_shape;
			$svg_html         = apply_filters( 'uabb_row_separator_svg_' . $row->separator_shape, $svg_html, $row );
			break;
	} // End switch.
}

/**
 * Filter separator clas
 *
 * @param str $separator_class
 * @param object $row The Beaver Builder row object.
 */
$separator_class = apply_filters( 'uabb_row_separator_class', $separator_class, $row );

/**
 * Filter SVG html output
 *
 * @param str $svg_html
 * @param object $row The Beaver Builder row object.
 */
$svg_html = apply_filters( 'uabb_row_separator_svg', $svg_html, $row );


if ( '' !== $svg_html ) { ?>
<div class="<?php echo esc_attr( $separator_class ); ?>" >
	<?php echo $svg_html; // phpcs:ignore WordPress.Security.EscapeOutput.OutputNotEscaped ?>
</div>
<?php } else { ?>
<div class="<?php echo esc_attr( $separator_class ); ?>" >
</div>
<?php } ?>
